import React from "react";
import styles from "./Login.module.css"
import { Box, Container, Button, Input, TextField } from "@material-ui/core";

function Login() {
  return (
    <Container classes={{root:styles.box}}  maxWidth="xs">
      <Box display ="flex" margin ={2} alignItems="center" justifyContent="center">
        <TextField
          margin="dense"
          label="Username"
          placeholder="Username"
          variant="outlined"
        />
      </Box>
      <Box display ="flex" margin ={2} alignItems="center" justifyContent="center">
        {" "}
        <TextField margin="dense" label="Email" placeholder="Email" />
      </Box>
      <Box display ="flex" margin ={2} alignItems="center" justifyContent="center">
        {" "}
        <TextField label="Password" margin="dense" placeholder="Username" />
      </Box>
      <Box display ="flex" margin ={2} alignItems="center" justifyContent="center">
        {" "}
        <Button variant="contained" color="primary">
          {" "}
          SUBMIT
        </Button>
      </Box>
    </Container>
  );
}
export { Login };
